import React from 'react';
import  Professional from './Professional';
import  Upload from './Upload';
import { Route, Switch } from 'react-router-dom';


const App = () => {

    return (
              <>
                <Switch>
                    <Route exact path="/Professional" target={Professional}/>
                </Switch>

              </>

    );
}
export default App;
